import * as React from 'react';
import './App.css';

import SectorSelectorForm from './components/SectorSelectorForm';
import { useAuth } from './hook/useAuth';

function App() {
  const { auth, login, logout } = useAuth();


  React.useEffect(() => {
    login();
  }, []);

  return (
    <div className="App">
      <SectorSelectorForm />
    </div>
  );
}

export default App;
